create table miembroAsociacion (
	idmiembro VARCHAR(40),
	idvehiculo VARCHAR(40),
	first_name VARCHAR(50),
	noasociacion VARCHAR(40),
	email VARCHAR(50),
	domicilio VARCHAR(50),
	fechai DATE,
	nocelular VARCHAR(50),
	esdueno VARCHAR(50),
	eschofer VARCHAR(50),
	primary key (idmiembro, idvehiculo)
);
